import React from "react"
import "./Jumbotron.css";

const Jumbotron = () => (
    <div className="Jumbotron">
    <h1 className="display-4">(React) Google Book Search</h1>
    <p className="lead">Search for and Save Books of Interest</p>
    
    
    
    </div>

    
)

export default Jumbotron
